/* eslint-disable import/no-anonymous-default-export */

    const projects = 
        {
        projectName: "The fun time project",
        description: "Create playgrounds, after school programs, and low cost sports programs for underprivileged kids",
        synopsis: "work with low income neighborhoods and schools to help create, budget and implement programs to keep high risk underprivileged kids off the streets.  These will be available at little to no costs to hard hit families by the pandemic.  Talk to local officials to get the okay to building and or upgrading parks, playgrounds, or ball courts",
